import React, { useEffect, useState } from 'react';
import { useParams } from "react-router-dom"
import classes from './Catalog.module.css';

interface UserParams {
    id: string
}

export default function Catalog() {
    const { id } = useParams<keyof UserParams>() as UserParams;
    const titles = ['первая', 'вторая', 'третья'];
    console.log(id);
    return (
        <main className={classes.catalog__container}>
            <h3>Каталог {id}</h3>
            <div className={classes.contacts__container}>
                {titles.map((el, id)=> {
                    return <span key={id} className={classes.contacts__cards}>{el}</span>
                })}
            </div>
        </main>
  );
}
